DO
$$
    DECLARE
        saved_uuid UUID;
    BEGIN
        WITH company_insert AS (
            INSERT INTO companies (name, tax_id_number, duns, industry, logo)
                VALUES ('PetroPower LLC', 234567890, 789012347, 'oil & gas', 'data:image/webp;base64,')
                RETURNING company_id
        )
        SELECT company_id INTO saved_uuid FROM company_insert;

        INSERT INTO company_addresses (company_id, address_line_1, city, state, zip_code)
        VALUES (saved_uuid, '404 Energy Way', 'Houston', 'TX', 77002);

        INSERT INTO company_phones (company_id, phone_number)
        VALUES (saved_uuid, '7135550404');
    END
$$;
